import React from 'react'

const PageIcon = ({imageURL}) => {
     return (
          <div style = { 
                              {
                                   width: '40px', 
                                   height: '40px', 
                                   margin: '10px',
                                   background: 'white',
                                   borderRadius: '50%',
                                   cursor: 'pointer'
                              } 
                    }>
               <img src = {imageURL} width = '40px' height = 'auto'/>     
          </div>
     )
}

export default PageIcon
